Bug: Curl Version Parsing Causes Script Exit
The curl version parsing is fragile. If curl --version output is unexpected, CURL_MAJOR or CURL_MINOR may not be valid integers. This causes the version comparison to fail with an "integer expression expected" error, leading the script to exit due to set -euo pipefail instead of gracefully falling back to the --fail flag.
